--
-- Name: tablelistwithkot; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.tablelistwithkot AS
 SELECT tbl.id,
    tbl.group_id,
    tbl.name,
    tbl.seq_no,
    tbl.active,
    tblgr.name AS group_name,
    ( SELECT count(*) AS count
           FROM public.t_transactions tr
          WHERE ((tr.v_type_id = 2) AND (tr.active = true) AND (tr.approved = true) AND (tr.table_id = tbl.id) AND (NOT (tr.transaction_id IN ( SELECT t_so_invoice.so_id
                   FROM (public.t_so_invoice
                     JOIN public.t_transactions trs ON ((t_so_invoice.invoice_id = trs.transaction_id)))
                  WHERE ((trs.active = true) AND (trs.approved = true))))))) AS kot_count,
    ( SELECT sum(tr.net_amount) AS sum
           FROM public.t_transactions tr
          WHERE ((tr.v_type_id = 2) AND (tr.active = true) AND (tr.approved = true) AND (tr.table_id = tbl.id) AND (NOT (tr.transaction_id IN ( SELECT t_so_invoice.so_id
                   FROM (public.t_so_invoice
                     JOIN public.t_transactions trs ON ((t_so_invoice.invoice_id = trs.transaction_id)))
                  WHERE ((trs.active = true) AND (trs.approved = true))))))) AS kot_amount,
    pi.display_trans_no,
    ( SELECT
                CASE
                    WHEN (count(table_session.id) > 0) THEN true
                    ELSE false
                END AS webactive
           FROM public.table_session
          WHERE ((table_session.active = true) AND (table_session.table_id = tbl.id))) AS webactive,
    ( SELECT table_session.waiter
           FROM public.table_session
          WHERE ((table_session.active = true) AND (table_session.table_id = tbl.id))) AS waiter,
    ( SELECT table_session.water
           FROM public.table_session
          WHERE ((table_session.active = true) AND (table_session.table_id = tbl.id))) AS water
   FROM ((public.m_tables tbl
     JOIN public.m_table_groups tblgr ON ((tbl.group_id = tblgr.id)))
     LEFT JOIN ( SELECT max((t_transactions.display_trans_no)::text) AS display_trans_no,
            t_transactions.table_id
           FROM public.t_transactions
          WHERE ((t_transactions.v_type_id = 5) AND (t_transactions.active = true) AND (t_transactions.non_receivable = false) AND (t_transactions.net_amount > (0)::double precision) AND ((t_transactions.advance = (0)::double precision) AND (NOT (t_transactions.transaction_id IN ( SELECT b.ref_trans_id
                   FROM (public.t_transaction_bills b
                     JOIN public.t_transactions ts ON ((ts.transaction_id = b.transaction_id)))
                  WHERE (ts.active = true))))))
          GROUP BY t_transactions.table_id
          ORDER BY (max(t_transactions.transaction_id))) pi ON ((pi.table_id = tbl.id)))
  ORDER BY tblgr.name, tbl.seq_no;


ALTER TABLE public.tablelistwithkot OWNER TO postgres;

--
-- Name: tables_with_kot; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.tables_with_kot AS
 SELECT tbl.id,
    tbl.group_id,
    tbl.name,
    tbl.seq_no,
    tbl.active,
    tbl.capacity,
    tblgr.name AS group_name,
    COALESCE(kot.cnt, (0)::bigint) AS kot_count,
    COALESCE(kot.kot_amount, (0)::double precision) AS kot_amount,
    pi.display_trans_no,
    COALESCE(tbl_session.webactive, false) AS webactive,
    COALESCE(tbl_session.waiter, false) AS waiter,
    COALESCE(tbl_session.water, false) AS water
   FROM ((((public.m_tables tbl
     JOIN public.m_table_groups tblgr ON ((tbl.group_id = tblgr.id)))
     LEFT JOIN ( SELECT max((t_transactions.display_trans_no)::text) AS display_trans_no,
            t_transactions.table_id
           FROM public.t_transactions
          WHERE ((t_transactions.v_type_id = 5) AND (t_transactions.active = true) AND (t_transactions.non_receivable = false) AND (t_transactions.net_amount > (0)::double precision) AND ((t_transactions.advance = (0)::double precision) AND (NOT (t_transactions.transaction_id IN ( SELECT b.ref_trans_id
                   FROM (public.t_transaction_bills b
                     JOIN public.t_transactions ts ON ((ts.transaction_id = b.transaction_id)))
                  WHERE (ts.active = true))))))
          GROUP BY t_transactions.table_id
          ORDER BY (max(t_transactions.transaction_id))) pi ON ((pi.table_id = tbl.id)))
     LEFT JOIN ( SELECT count(*) AS cnt,
            tr.table_id,
            sum(tr.net_amount) AS kot_amount
           FROM public.t_transactions tr
          WHERE ((tr.v_type_id = 2) AND (tr.active = true) AND (tr.approved = true) AND (NOT (tr.transaction_id IN ( SELECT t_so_invoice.so_id
                   FROM (public.t_so_invoice
                     JOIN public.t_transactions trs ON ((t_so_invoice.invoice_id = trs.transaction_id)))
                  WHERE ((trs.active = true) AND (trs.approved = true))))))
          GROUP BY tr.table_id) kot ON ((kot.table_id = tbl.id)))
     LEFT JOIN ( SELECT
                CASE
                    WHEN (count(table_session.id) > 0) THEN true
                    ELSE false
                END AS webactive,
            every(table_session.waiter) AS waiter,
            every(table_session.water) AS water,
            table_session.table_id
           FROM public.table_session
          WHERE (table_session.active = true)
          GROUP BY table_session.table_id) tbl_session ON ((tbl_session.table_id = tbl.id)))
  ORDER BY tblgr.name, tbl.seq_no;


ALTER TABLE public.tables_with_kot OWNER TO postgres;

--
-- Name: v_balance_sheet; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_balance_sheet AS
 SELECT
        CASE
            WHEN ((grp.ledger_type)::text = 'Assets'::text) THEN ac.amount
            ELSE NULL::double precision
        END AS ast_amt,
        CASE
            WHEN ((grp.ledger_type)::text = 'Liabilities'::text) THEN ac.amount
            ELSE NULL::double precision
        END AS lbt_amt,
        CASE
            WHEN ((grp.ledger_type)::text = 'Income'::text) THEN ac.amount
            ELSE NULL::double precision
        END AS income_amt,
        CASE
            WHEN ((grp.ledger_type)::text = 'Expense'::text) THEN ac.amount
            ELSE NULL::double precision
        END AS expense_amt,
    grp.group_name,
    grp.ledger_type
   FROM ((public.m_accounts ac
     JOIN public.m_ledgers lr ON ((ac.ledger_id = lr.ledger_id)))
     JOIN public.m_ledger_groups grp ON ((lr.group_id = grp.group_id)));


ALTER TABLE public.v_balance_sheet OWNER TO postgres;

--
-- Name: v_item_stock; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_item_stock AS
 SELECT rst.trans_item_id,
    rst.item_id,
    rst.item_name,
    rst.item_type,
    rst.category_id,
    rst.category_name,
    rst.location_name,
    rst.transaction_id,
    rst.ledger_id,
    rst.ledger_name,
    rst.p_rate,
    rst.s_rate,
    rst.mrp,
    rst.active,
    rst.v_type_id,
    rst.trans_no,
    rst.trans_date,
    rst.location_id,
    rst.in_item,
    rst.out_item
   FROM ( SELECT tr_itm.trans_item_id,
            tr_itm.item_id,
            itm.item_name,
            itm.item_type,
            cat.category_id,
            cat.category_name,
            loc.name AS location_name,
            tr_itm.transaction_id,
            lr.ledger_id,
            lr.ledger_name,
            tr_itm.p_rate,
            tr_itm.s_rate,
            tr_itm.mrp,
            tr_itm.active,
            tr.v_type_id,
            tr.trans_no,
            tr.trans_date,
            tr_itm.location_id,
                CASE
                    WHEN (tr.v_type_id = ANY (ARRAY[4, 6, 7])) THEN tr_itm.qty
                    WHEN (((tr.v_type_id = 15) OR (tr.v_type_id = 16)) AND (tr_itm.qty > (0)::numeric)) THEN tr_itm.qty
                    ELSE (0)::numeric
                END AS in_item,
                CASE
                    WHEN (tr.v_type_id = ANY (ARRAY[3, 5, 8])) THEN tr_itm.qty
                    WHEN (((tr.v_type_id = 15) OR (tr.v_type_id = 16)) AND (tr_itm.qty < (0)::numeric)) THEN abs(tr_itm.qty)
                    ELSE (0)::numeric
                END AS out_item
           FROM (((((public.t_transactions tr
             JOIN public.t_transaction_items tr_itm USING (transaction_id))
             LEFT JOIN public.m_ledgers lr ON ((tr.ledger_id = lr.ledger_id)))
             LEFT JOIN public.m_items itm ON ((tr_itm.item_id = itm.item_id)))
             LEFT JOIN public.m_categorys cat ON ((cat.category_id = itm.category_id)))
             LEFT JOIN public.m_locations loc ON ((loc.id = tr_itm.location_id)))
          WHERE (((NOT (tr.transaction_id IN ( SELECT t_grn_purchase.purchase_id
                   FROM public.t_grn_purchase))) AND (tr.v_type_id = ANY (ARRAY[4, 6, 7]))) OR ((tr.transaction_id IN ( SELECT t_grn_purchase.purchase_id
                   FROM public.t_grn_purchase)) AND (tr.v_type_id = ANY (ARRAY[4, 6]))) OR ((NOT (tr.transaction_id IN ( SELECT t_do_invoice.invoice_id
                   FROM public.t_do_invoice))) AND (tr.v_type_id = ANY (ARRAY[3, 5, 8]))) OR ((tr.transaction_id IN ( SELECT t_do_invoice.invoice_id
                   FROM public.t_do_invoice)) AND (tr.v_type_id = ANY (ARRAY[3, 8]))) OR (tr.v_type_id = ANY (ARRAY[15, 16])))
        UNION
         SELECT NULL::integer,
            itm.item_id,
            itm.item_name,
            itm.item_type,
            cat.category_id,
            cat.category_name,
            loc.name AS location_name,
            NULL::integer,
            NULL::integer,
            NULL::character varying,
            itm.p_rate,
            itm.s_rate,
            itm.mrp,
            true AS active,
            NULL::integer,
            NULL::integer,
            NULL::timestamp without time zone,
            locob.location_id,
            locob.ob AS in_item,
            0
           FROM (((public.m_items itm
             LEFT JOIN public.m_categorys cat ON ((cat.category_id = itm.category_id)))
             LEFT JOIN public.m_locations loc ON ((loc.id = itm.location_id)))
             LEFT JOIN public.m_item_location_ob locob ON ((locob.item_id = itm.item_id)))) rst
  WHERE ((rst.item_type)::text <> 's'::text);


ALTER TABLE public.v_item_stock OWNER TO postgres;

--
-- Name: v_ledger_details; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_ledger_details AS
( SELECT acc.transaction_id,
    acc.voucher_no,
    acc.voucher_date,
    acc.rc_date,
    acc.payment_mode,
    vt.v_type_name,
    l.ledger_id,
        CASE
            WHEN ((acc.account_type)::text = (vt.default_ac_type)::text) THEN ( SELECT m_ledgers.ledger_name
               FROM public.m_ledgers
              WHERE (m_ledgers.ledger_id = ( SELECT m_accounts.ledger_id
                       FROM public.m_accounts
                      WHERE ((m_accounts.v_type_id = acc.v_type_id) AND ((m_accounts.voucher_no)::text = (acc.voucher_no)::text) AND ((m_accounts.account_type)::text = (vt.alt_ac_type)::text)))))
            ELSE ( SELECT m_ledgers.ledger_name
               FROM public.m_ledgers
              WHERE (m_ledgers.ledger_id = ( SELECT m_accounts.ledger_id
                       FROM public.m_accounts
                      WHERE ((m_accounts.v_type_id = acc.v_type_id) AND ((m_accounts.voucher_no)::text = (acc.voucher_no)::text) AND ((m_accounts.account_type)::text = (vt.default_ac_type)::text)))))
        END AS ledgername,
    acc.account_type,
        CASE
            WHEN ((acc.dc)::text = 'D'::text) THEN
            CASE
                WHEN (((vt.v_type_name)::text = 'Payment'::text) OR ((vt.v_type_name)::text = 'Receipt'::text) OR ((vt.v_type_name)::text = 'Expense'::text) OR ((vt.v_type_name)::text = 'Journal'::text) OR ((vt.v_type_name)::text = 'CashBank'::text) OR ((vt.v_type_name)::text = 'Invoice'::text) OR ((vt.v_type_name)::text = 'InvoiceReturn'::text) OR ((vt.v_type_name)::text = 'Purchase'::text) OR ((vt.v_type_name)::text = 'PurchaseReturn'::text) OR ((vt.v_type_name)::text = 'GRN'::text) OR ((vt.v_type_name)::text = 'DeliveryOrder'::text)) THEN abs(acc.amount)
                ELSE (0)::double precision
            END
            ELSE (0)::double precision
        END AS dr,
        CASE
            WHEN ((acc.dc)::text = 'C'::text) THEN
            CASE
                WHEN (((vt.v_type_name)::text = 'Payment'::text) OR ((vt.v_type_name)::text = 'Receipt'::text) OR ((vt.v_type_name)::text = 'Expense'::text) OR ((vt.v_type_name)::text = 'Journal'::text) OR ((vt.v_type_name)::text = 'CashBank'::text) OR ((vt.v_type_name)::text = 'Invoice'::text) OR ((vt.v_type_name)::text = 'InvoiceReturn'::text) OR ((vt.v_type_name)::text = 'Purchase'::text) OR ((vt.v_type_name)::text = 'PurchaseReturn'::text) OR ((vt.v_type_name)::text = 'GRN'::text) OR ((vt.v_type_name)::text = 'DeliveryOrder'::text)) THEN abs(acc.amount)
                ELSE (0)::double precision
            END
            ELSE (0)::double precision
        END AS cr,
    acc.active
   FROM ((public.m_accounts acc
     JOIN public.m_voucher_types vt ON ((acc.v_type_id = vt.v_type_id)))
     JOIN public.m_ledgers l ON ((acc.ledger_id = l.ledger_id)))
  WHERE ((acc.active = true) AND ((acc.trans_sq = 1) OR (acc.trans_sq IS NULL)))
  ORDER BY acc.voucher_date)
UNION
 SELECT NULL::integer AS transaction_id,
    NULL::integer AS voucher_no,
    NULL::timestamp without time zone AS voucher_date,
    NULL::timestamp without time zone AS rc_date,
    NULL::character varying AS payment_mode,
    NULL::character varying AS v_type_name,
    l.ledger_id,
    l.ledger_name AS ledgername,
    NULL::character varying AS account_type,
        CASE
            WHEN ((l.obdrcr)::text = 'DR'::text) THEN l.ob
            ELSE (0)::double precision
        END AS dr,
        CASE
            WHEN ((l.obdrcr)::text = 'CR'::text) THEN l.ob
            ELSE (0)::double precision
        END AS cr,
    NULL::boolean AS active
   FROM public.m_ledgers l;


ALTER TABLE public.v_ledger_details OWNER TO postgres;

