ALTER TABLE public.v_reports_details OWNER TO postgres;

--
-- Name: v_tax_summary; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_tax_summary AS
 SELECT res.trans_no,
    res.trans_date,
    res.taxslabs AS taxslab,
    res.ledger_id,
    res.v_type_id,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.total_amount
        END AS total_amount,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.net_amount
        END AS net_amount,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.roundoff_amt
        END AS roundoff_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.other1_amt
        END AS other1_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.other2_amt
        END AS other2_amt,
        CASE
            WHEN res.non_receivable THEN (0)::numeric
            ELSE res.qty
        END AS qty,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.amount
        END AS amount,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.taxable_amt
        END AS taxable_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.sgst_amt
        END AS sgst_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.cgst_amt
        END AS cgst_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.igst_amt
        END AS igst_amt,
        CASE
            WHEN res.non_receivable THEN (0)::double precision
            ELSE res.dis_amt
        END AS dis_amt,
    res.gstin,
    res.non_receivable
   FROM (( SELECT tr.trans_no,
            tr.trans_date,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN tr.taxslab
                    ELSE itm.taxslab
                END AS taxslabs,
            tr.ledger_id,
            tr.v_type_id,
            max(tr.total_amount) AS total_amount,
            max(tr.net_amount) AS net_amount,
            max(tr.roundoff_amt) AS roundoff_amt,
            max(tr.other1_amt) AS other1_amt,
            max(tr.other2_amt) AS other2_amt,
            sum(ti.qty) AS qty,
            sum(ti.amount) AS amount,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN max(tr.taxable_amt)
                    ELSE sum(ti.taxable_amt)
                END AS taxable_amt,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN max(tr.sgst_amt)
                    ELSE sum(ti.sgst_amt)
                END AS sgst_amt,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN max(tr.cgst_amt)
                    ELSE sum(ti.cgst_amt)
                END AS cgst_amt,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN max(tr.igst_amt)
                    ELSE sum(ti.igst_amt)
                END AS igst_amt,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN max(tr.discount_amt)
                    ELSE sum(ti.dis_amt)
                END AS dis_amt,
            tr.gstin,
            tr.non_receivable
           FROM ((public.t_transactions tr
             LEFT JOIN public.t_transaction_items ti ON ((tr.transaction_id = ti.transaction_id)))
             LEFT JOIN public.m_items itm ON ((ti.item_id = itm.item_id)))
          WHERE ((ti.amount IS NOT NULL) AND (tr.active = true))
          GROUP BY tr.trans_no,
                CASE
                    WHEN (tr.taxslab > (0)::double precision) THEN tr.taxslab
                    ELSE itm.taxslab
                END, tr.ledger_id, tr.v_type_id, tr.trans_date, tr.gstin, tr.taxslab, tr.non_receivable
          ORDER BY tr.trans_no)
        UNION
        ( SELECT tr.trans_no,
            tr.trans_date,
            NULL::double precision AS taxslabs,
            tr.ledger_id,
            tr.v_type_id,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE max(tr.total_amount)
                END AS total_amount,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE max(tr.net_amount)
                END AS net_amount,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE max(tr.roundoff_amt)
                END AS roundoff_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE max(tr.other1_amt)
                END AS other1_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE max(tr.other2_amt)
                END AS other2_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::numeric
                    ELSE sum(ti.qty)
                END AS qty,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE sum(ti.amount)
                END AS amount,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE
                    CASE
                        WHEN (tr.taxslab > (0)::double precision) THEN max(tr.taxable_amt)
                        ELSE sum(ti.taxable_amt)
                    END
                END AS taxable_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE
                    CASE
                        WHEN (tr.taxslab > (0)::double precision) THEN max(tr.sgst_amt)
                        ELSE sum(ti.sgst_amt)
                    END
                END AS sgst_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE
                    CASE
                        WHEN (tr.taxslab > (0)::double precision) THEN max(tr.cgst_amt)
                        ELSE sum(ti.cgst_amt)
                    END
                END AS cgst_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE
                    CASE
                        WHEN (tr.taxslab > (0)::double precision) THEN max(tr.igst_amt)
                        ELSE sum(ti.igst_amt)
                    END
                END AS igst_amt,
                CASE
                    WHEN tr.non_receivable THEN (0)::double precision
                    ELSE
                    CASE
                        WHEN (tr.taxslab > (0)::double precision) THEN max(tr.discount_amt)
                        ELSE sum(ti.dis_amt)
                    END
                END AS dis_amt,
            tr.gstin,
            tr.non_receivable
           FROM ((public.t_transactions tr
             LEFT JOIN public.t_transaction_items ti ON ((tr.transaction_id = ti.transaction_id)))
             LEFT JOIN public.m_items itm ON ((ti.item_id = itm.item_id)))
          WHERE ((ti.amount IS NOT NULL) AND (tr.active = true))
          GROUP BY tr.trans_no, tr.ledger_id, tr.v_type_id, tr.trans_date, tr.gstin, tr.taxslab, tr.non_receivable
          ORDER BY tr.trans_no)) res
  ORDER BY res.v_type_id, res.trans_no, res.taxslabs DESC;


